On request, I've made a new version of the top to suit securing the halves together using a captuve nut arrangement. It's sized to suit a 3mm nut and bolt, 1/8th inch might also work. &quot;Top,_captive_nut.stl&quot;
In response to another request, I also made a version with a hole for access to the SD card slot of the VecMulti multicart. &quot;Top,_SD_Card_Slot.stl&quot;
Finally, there's a version of the top with both of these modifications. &quot;Top,_SD_Card_Slot,_captive_nut.stl&quot;
I haven't tried printing any of these new versions myself yet, so print at your own risk.
